import { makeStyles } from '@material-ui/core/styles';

export default makeStyles((theme) => ({
  root: {
    '& .MuiTextField-root': {
      margin: theme.spacing(1),
    },
  },
  card: {
    maxWidth: 350,
    marginBottom: 20,
  },
  title: {
    marginTop: 5,
  },
  form: {
    display: 'flex',
    flexWrap: 'wrap',
    flexDirections: 'column',
    justifyContent: 'center',
  },
  fileInput: {
    width: '97%',
    margin: '10px 0',
  },
  button: {
    margin: 5,
    marginBottom: 10,
  },
}));
